  Code = "class Solution:\n    def sequentialDigits(self, low, high):\n        a = []\n\n        for i in range(1, 10):\n            num = i\n            next_digit = i + 1\n\n            while num <= high and next_digit <= 9:\n                num = num * 10 + next_digit\n                if low <= num <= high:\n                    a.append(num)\n                next_digit += 1\n\n        a.sort()\n        return a\n\n\n"
